module.exports = "<div class=\"row m-0\">\n    <div class=\"col p-0\">\n      <h5 class=\"pt-3 pl-3\" style=\"border-bottom:1px dotted black;\">About Warangal <span><i class=\"fas fa-angle-double-right\"></i></span></h5>\n    </div>\n  </div>\n  <div class=\"row m-0\">\n    <div class=\"col p-0\">\n      <h6 class=\"pt-2 pl-4\">Historical Warangal & Tourist Places</h6>\n      <p class=\"pt-2 pl-4 pr-4\">Kakatiya University is located in the historical City of Warangal in Indian State of Telangana.\n         The University has been named after the great Kakatiya Dynasty which ruled this region with Warangal as capital during the twelfth and thirteenth centuries. \n         The benevolent Kakatiya rulers ensured political stability, economic prosperity, linguistic and cultural unity and bestowed artistic splendour and literary efflorescence on the kingdom they built. \n         The term \"Kakatiya\" strikes an emotional chord in the hearts of the Telugu people. \n      </p>\n    </div></div>\n    <div class=\"row m-0\">\n      <div class=\"col-8 p-0\">\n        <h6 class=\"pt-2 pl-4\">Bhadrakali Temple</h6>\n        <p class=\"pt-2 pl-4 pr-4\">Dedicated to the Goddess 'Bhadrakali' is a precious deity of this region. Located on the hilltop between the twin cities of Hanamkonda and Warangal with a artificial lake of 2 ½ kms radius is one of the major attractions of the city. The main attraction of the temple is the square image of the goddess (2.7 X 2.7 meters), an ancient Bhadrakali in sitting posture wearing a crown with eight hands, holding weapons. The festive occasion of visiting this temple is in the telugu month of 'Sravana' (August-September), when the deity is decorated in various forms becoming an major attractions to the devotees.\n           The surrounding mountain area of the temple is developed into a sacred one with about 8 major and 12 minor temples attracting lot number of devotees.</p>\n      </div>\n      <div class=\"col-4 p-0\">\n        <img src=\"assets/Bhadrakali1.jpg\" alt=\"\" class=\"img-fluid mt-5\"style=\"border:1px solid black;border-radius:30px;\">\n      </div>\n    </div>\n    <div class=\"row m-0\">\n        <div class=\"col-4 p-0\">\n            <img src=\"assets/1000pillers.jpg\" alt=\"\" class=\"img-fluid mt-4 ml-2\" style=\"border:1px solid black;border-radius:30px;\">\n          </div>\n        <div class=\"col-8 p-0\">\n          <h6 class=\"pt-2 pl-4\">The Thousand Pillar Temple</h6>\n          <p class=\"pt-2 pl-4 pr-4\">The Thousand Pillar Temple with its ruins lies near the Hanamkonda-Warangal Highway in Telangana State, about 150 kilometres (93 mi) from the city of Hyderabad.<br>\n\n              Rudreswara Temple locally known as Veyisthambala Gudi (Thousand pillars temple) is one of the fine and earliest available examples of Kakatiya art, architecture and sculpture.\n               It was built by Rudra Deva, and named after him as ‘Sri Rudreswara swamy temple with the presiding deity as Rudreswara, in 1163 AD in the style of later Chalukyan and early Kakatiyan Architecture, star shaped and triple shrined (Trikutalaya).\n              Strengthening of foundations like sand box technique, the skill of Kakatiya sculptors is manifest in adroit craftsmanship and flawless ivory carving technique in their art.\n               The ingenuity of Kakatiya sculptors is visible in likes of lathe turned, and shiny polish in dolerite and granite stone sculpture and craft work of Nava rangamandapa.</p>\n        </div> \n      </div>\n      <div class=\"row m-0\">\n          <div class=\"col-8 p-0\">\n            <h6 class=\"pt-2 pl-4\">Laknavaram Lake</h6>\n            <p class=\"pt-2 pl-4 pr-4\">The lake is spread over an area of 10,000 acres and holds about 2.135 tmcft of water. It irrigates over 3,500 acres of land. It was built by Kakatiya kings. It has about 13 islands in it and has a 160 metres long hanging bridge, which connects three islands. It is surrounded by a thick deciduous forest and it is a very popular tourist spot.\n\n                The new facilities including cottages, a viewing tower, a pantry, and a ferry from the main banks to the island amidst the serene waters has been opened for the nature loving tourists.[3]</p>\n          </div>\n          <div class=\"col-4 p-0\">\n            <img src=\"assets/laknavaram.jpg\" alt=\"\" class=\"img-fluid mt-5 mb-4\"style=\"border:1px solid black;border-radius:30px;\">\n          </div>\n        </div>"

